import './App.css'
import {BrowserRouter as Router, Routes, Route} from "react-router-dom"
import Header from './components/Header'

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<><Header /></>}></Route>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
